import React, { Component } from 'react'

class Error extends Component {
    render() {
        return (

        <div className="div-error-page">

           <p className="mb-0 font-big">סליחה</p>
           <h1 className="mt-0">לא מצאנו את מה שחיפשת</h1>
           <p className="mt-1 mb-1">כדאי לבדוק אם הכתובת שהזנת נכונה</p>
           <p >נסה לחפש שוב או המשך לדף הבית שלנו</p>
               
        </div>

        )
    }
}

export default Error
